Mongoose: findByIdAndUpdate is not working even after passing {new:true}<p>POST and DELETE requests are working but PUT is not working even after passing <code>{new: true}</code> as other answers suggested.
I checked the documentation for mongoose and didn't find anything that might solve the problem.</p>

<p>Terminal log is: <code>PUT /api/persons/5dfbb8677d7d960358dbdead 404 175 - 2.273 ms -</code></p>

<p>The request body is not logging and only a '-' is logged. This is not the case with POST.</p>

<p>Relevant code:</p>

<pre><code>app.post('/api/persons', (request, response) =&gt; {
  const body = request.body

  const person = new Person({
    name: body.name,
    number: body.number,
  })

  person
  .save()
  .then(savedContact =&gt; {
    response.json(savedContact.toJSON())
  })
})

app.put('api/persons/:id', (request, response, next) =&gt; {
  const body = request.body
  const person = {
    name: body.name,
    number: body.number,
  }

  person
  .findByIdAndUpdate(request.params.id, person, { new: true })
  .then(updatedContact =&gt; {
      response.json(updatedContact.toJSON())
    })
  .catch(error =&gt; next(error))
})

app.delete('/api/persons/:id', (request, response, next) =&gt; {
  Person
  .findByIdAndRemove(request.params.id)
  .then(result =&gt; {
    response.status(204).end()
  })
  .catch(error =&gt; {next(error)})

const errorHandler = (error, request, response, next) =&gt; {

  if (error.name === 'CastError' &amp;&amp; error.kind == 'ObjectId') {
    return response.status(400).send({ error: 'malformatted id' })
  }

  next(error)
}

app.use(errorHandler)
})
</code></pre>

<p>Complete File:</p>

<pre><code>require('dotenv').config()
const express = require('express')
const app = express()
app.use(express.static('build'))

const bodyParser = require('body-parser')
app.use(bodyParser.json())

const cors = require('cors')
app.use(cors())

const morgan = require('morgan')

morgan.token('req_body', function(req, res) {
  if (req.method === 'POST' || req.method === 'PUT'){
    return JSON.stringify(req.body);
  }
});

morgan.token('req_key', function(req, res) {
  if (req.method === 'GET' || req.method === 'PUT'){
    return JSON.stringify(req.params.id);
  }
});

app.use(morgan(':method :url :status :res[content-length] - :response-time ms :req_body :req_key'))

const Person = require('./models/person')

app.get('/api/persons', (request, response) =&gt; {
  Person.find({}).then(persons =&gt; {
    response.json(persons.map(person =&gt; person.toJSON()))
  })
})

app.get('/api/persons/:id', (request, response) =&gt; {
  Person
  .findById(request.params.id)
  .then(person =&gt; {
